import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import RSS from './RSS'
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
  <React.StrictMode>
    <App />
    <RSS />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
